import React, { useState } from "react";
import "./App.css";
import Grid from "./Grid";
import GameOver from "./GameOver";

function App() {
  const [gameOver, setGameOver] = useState(false);
  return;
  {
    gameOver ? (
      <div>
        <GameOver />
      </div>
    ) : (
      <div>
        <Grid />
      </div>
    );
  }
}

export default App;
